static uint32_t netmask_from_prefix(unsigned prefix)
{
    if (prefix == 0)
    {
        return 0;
    }
    if (prefix >= 32)
    {
        return 0xFFFFFFFFU;
    }
    return 0xFFFFFFFFU << (32 - prefix);
}

static int prefix_from_netmask(uint32_t netmask)
{
    if (netmask == 0)
    {
        return 0;
    }
    int bits = 0;
    for (int i = 31; i >= 0; --i)
    {
        if ((netmask >> i) & 1U)
        {
            ++bits;
        }
        else
        {
            break;
        }
    }
    return bits;
}

